import {
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
  IonButton
} from '@ionic/react';

import { Directory, Filesystem } from '@capacitor/filesystem';
import { Share } from '@capacitor/share';

import ExploreContainer from '../components/ExploreContainer';
import './Home.css';

function share(fileName: string, base64Data: string) {
  return Filesystem.writeFile({
    path: fileName,
    data: base64Data,
    directory: Directory.Cache,
    recursive: true
  })
    .then(() => {
      return Filesystem.getUri({
        directory: Directory.Cache,
        path: fileName
      });
    })
    .then((uriResult) => {
      return Share.share({
        title: fileName,
        text: fileName,
        url: uriResult.uri,
      });
    });
}

const Home: React.FC = () => {

  const handleShare = async () => {
    const base64Image = '';

    share('my_cache_images/image.png', base64Image);
  };

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Test Share</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Test Share</IonTitle>
          </IonToolbar>
        </IonHeader>

        <ExploreContainer />

        <IonButton expand="block" onClick={handleShare}>
          Share Image
        </IonButton>

      </IonContent>
    </IonPage>
  );
};

export default Home;
